    static char START_POINT = 'S';
    static char END_POINT = 'E';
    static char WALL = '#';
    static char EMPTY = '.';
    static char NEW_EMPTY = '_';
    static char UP = '^';
    static char DOWN = 'v';
    static char LEFT = '<';
    static char RIGHT = '>';
    static int ROTATE_POINTS = 1000;

    static int X = 0;
    static int Y = 0;
    static Long[][] SCORE_MAP;
    static Long LOWEST_SCORE = Long.MAX_VALUE;
    static Character[][] MAP;
    static int count = 0;

    public static long solutionForPartOne(Character[][] map) {

        SCORE_MAP = new Long[map.length][map[0].length];

        for (int i = 0; i < map.length; i++) {
            for (int j = 0; j < map[i].length; j++) {
                if (map[i][j] == EMPTY) {
                    map[i][j] = NEW_EMPTY;
                }
                if (map[i][j] == START_POINT) {
                    X = j;
                    Y = i;
                }
                SCORE_MAP[i][j] = Long.MAX_VALUE;
            }
        }
        MAP = deepCopyArray(map);

//        Character[][] upMap = deepCopyArray(map), downMap = deepCopyArray(map), leftMap = deepCopyArray(map), rightMap = deepCopyArray(map);

        nextStep(MAP, X, Y - 1, 1000, UP);
        nextStep(MAP, X, Y + 1, 1000, DOWN);
        nextStep(MAP, X - 1, Y, 2000, LEFT);
        nextStep(MAP, X + 1, Y, 0, RIGHT);

        System.out.println("count is " + count);
        return LOWEST_SCORE;
    }


    public static void nextStep(Character[][] map, int x, int y, long score, char dir) {
        char p = map[y][x];

        if (p == WALL) {
            return;
        }

        if (p == END_POINT) {
            count++;
            System.out.println("-------------------------------------------------" + ++score);
            SCORE_MAP[y][x] = score;
            LOWEST_SCORE = Math.min(LOWEST_SCORE, score);
            return;
        }


        score++;
        if (score >= SCORE_MAP[y][x]) {
            return;
        } else {
            SCORE_MAP[y][x] = score;
        }


//        {
//            if (dir == UP) {
//                map[y][x] = UP;
//            }
//            if (dir == DOWN) {
//                map[y][x] = DOWN;
//            }
//            if (dir == LEFT) {
//                map[y][x] = LEFT;
//            }
//            if (dir == RIGHT) {
//                map[y][x] = RIGHT;
//            }
//        }

        long upScore = score, downScore = score, leftScore = score, rightScore = score;
//        Character[][] upMap = deepCopyArray(map), downMap = deepCopyArray(map), leftMap = deepCopyArray(map), rightMap = deepCopyArray(map);

        if (dir == RIGHT || dir == LEFT) {
            upScore += ROTATE_POINTS;
        } else if (dir == DOWN) {
            upScore += 2 * ROTATE_POINTS;
        }
        nextStep(MAP, x, y - 1, upScore, UP);

        if (dir == RIGHT || dir == LEFT) {
            downScore += ROTATE_POINTS;
        } else if (dir == UP) {
            downScore += 2 * ROTATE_POINTS;
        }
        nextStep(MAP, x, y + 1, downScore, DOWN);

        if (dir == UP || dir == DOWN) {
            leftScore += ROTATE_POINTS;
        } else if (dir == RIGHT) {
            leftScore += 2 * ROTATE_POINTS;
        }
        nextStep(MAP, x - 1, y, leftScore, LEFT);

        if (dir == UP || dir == DOWN) {
            rightScore += ROTATE_POINTS;
        } else if (dir == LEFT) {
            rightScore += 2 * ROTATE_POINTS;
        }
        nextStep(MAP, x + 1, y, rightScore, RIGHT);
    }


    public static <T> T[][] deepCopyArray(T[][] original) {
        if (original == null) {
            return null;
        }
        final T[][] result = original.clone();
        for (int i = 0; i < original.length; i++) {
            result[i] = original[i].clone();
        }
        return result;
    }
